static const unsigned _n_serialized_words = 429;

const piece *_piecegen_get_piece(unsigned phase, unsigned features)
{
    if (phase >= _n_phases) return 0;
    if (features >= _phase_size[phase]) return 0;
    if (_phases[phase][features]->n_pieces != 0) return 0;
    return _phases[phase][features]->p;
}

const piece *_piecegen_get_indexed_piece(unsigned phase, unsigned features, unsigned index)
{
    if (phase >= _n_phases) return 0;
    if (features >= _phase_size[phase]) return 0;
    if (index >= _phases[phase][features]->n_pieces) return 0;
    return &_phases[phase][features]->p[index];
}

const uniform_initializer *_piecegen_get_uniform_initializers(unsigned *n_inits)
{
    *n_inits = _n_uniform_initializers;
    return _uniform_initializers;
}

const unsigned *_piecegen_get_serialized_data(unsigned *n_words)
{
    *n_words = _n_serialized_words;
    return _serialized;
}

